//------ PRIVATE MEMBER FUNCTIONS ------


double SKChannels::matrixElement(double s, double W, double theta, double thetaStar, double phiStar) const {

  double ret{ 0 };
  
  if(p.kaon_CT) { ret += CT(s, W, theta, thetaStar, phiStar); }
	if(p.kaon_CRLambda) {
    double temp{ CrossLambda(s, W, theta, thetaStar, phiStar) };
    ret += (temp < 0 ? 0 : temp);
  }
  if(p.kaon_CRSigma) { ret += CrossSigma(s, W, theta, thetaStar, phiStar); }
  if(p.kaon_PionInFlight) { ret += PionInFlight(s, W, theta, thetaStar, phiStar); }
  if(p.kaon_EtaInFlight) { ret += EtaInFlight(s, W, theta, thetaStar, phiStar); }
  if(p.kaon_KaonPole) { ret += KaonPole(s, W, theta, thetaStar, phiStar); }
	
	//std::cout << "ret=" << ret << '\n';

	//if(ret < 0) return 0;

  assert(ret > 0);

  return GF * GF * ret;
}

double SKAntiChannels::matrixElement(double s, double W, double theta, double thetaStar, double phiStar) const {

  double ret{ 0 };

  if(p.kaon_CT_anti) { ret += CT(s, W, theta, thetaStar, phiStar); }
	if(p.kaon_Lambda_anti) { 
    double temp{ Lambda(s, W, theta, thetaStar, phiStar) };
    ret += (temp < 0 ? 0 : temp);
  }  
  if(p.kaon_Sigma_anti) { ret += Sigma(s, W, theta, thetaStar, phiStar); }
  if(p.kaon_SigmaStar_anti) { ret += SigmaStar(s, W, theta, thetaStar, phiStar); }
  if(p.kaon_PionInFlight_anti) { ret += PionInFlight(s, W, theta, thetaStar, phiStar); }
  if(p.kaon_EtaInFlight_anti) {
		double temp{ EtaInFlight(s, W, theta, thetaStar, phiStar) };
    ret += (temp < 0 ? 0 : temp);
	}
  if(p.kaon_KaonPole_anti) { ret += KaonPole(s, W, theta, thetaStar, phiStar); }

	//std::cout << "ret=" << ret << '\n';

	//if(ret < 0) return 0;

  assert(ret >= 0);

  return GF * GF * ret;
}

//------ CONSTRUCT CHANNELS ------

void SingleKaonConstruct(params& p) {

	int currentCount{ p.kaon_CT + p.kaon_CRSigma + p.kaon_CRLambda + p.kaon_KaonPole + p.kaon_PionInFlight + p.kaon_EtaInFlight };
	int currentCountAnti{ p.kaon_CT_anti + p.kaon_Sigma_anti + p.kaon_SigmaStar_anti + p.kaon_Lambda_anti + p.kaon_KaonPole_anti + p.kaon_PionInFlight_anti + p.kaon_EtaInFlight_anti };

	int channelCount{ 2*(p.kaon_Kplus && currentCount > 0) + (p.kaon_Kzero && currentCount > 0) };
	//std::cout << "channels=" << channelCount << '\n';
	int channelCountAnti{ 2*(p.kaon_Kminus && currentCountAnti > 0) + (p.kaon_KzeroBar && currentCountAnti > 0) };
	//std::cout << "anti channels=" << channelCountAnti << '\n';
	
	int splines{ p.kaon_W_bins * p.kaon_theta_bins * p.kaon_thetaStar_bins * p.kaon_phiStar_bins };
	if(!p.kaon_fullBeam) splines *= p.kaon_beam_bins;
	else {

	}
	//std::cout << "splines=" << splines << '\n';

	int work{ channelCount * splines };
	int workAnti{ channelCountAnti * splines };
	int total{ work + workAnti };
	//std::cout << "Total=" << total << '\n';
	phase23::TwoThreePhaseSpace::totalWork += total; 
	//std::cout << "Total member=" << phase23::TwoThreePhaseSpace::totalWork << '\n';

	if(p.kaon_Kplus && currentCount > 0) {
		SingleKaonPP::construct(p);	
		SingleKaonNN::construct(p);	
	}

	if(p.kaon_Kminus && currentCountAnti > 0) {
		SingleKaonAntiPP::construct(p);	
		SingleKaonAntiNN::construct(p);	
	}

	if(p.kaon_Kzero && currentCount > 0) {
		SingleKaonNP::construct(p);	
	}

	if(p.kaon_KzeroBar && currentCountAnti > 0) {
		SingleKaonAntiPN::construct(p);	
	}

	phase23::TwoThreePhaseSpace::printProgress(); 
	std::cout << "\n\n";	
}

//------ MATRIX ELEMENTS ------

double SKChannels::CT(double s, double W, double theta, double thetaStar, double phiStar) const {
  int GF{1};
  double constants{(Power(ACT,2)*Power(GF,2)*Power(Vus,2))/(4*Power(fPi,2))};

  double matrixElementBody{64*(Power(1 + BCT,2)*Pair(Momentum(s,p1,W,theta,thetaStar,phiStar),Momentum(s,q3,W,theta,thetaStar,phiStar))*
     Pair(Momentum(s,p2,W,theta,thetaStar,phiStar),Momentum(s,q1,W,theta,thetaStar,phiStar)) + 
     (-1 + BCT)*((1 + BCT)*m1*ma*Pair(Momentum(s,p2,W,theta,thetaStar,phiStar),Momentum(s,q3,W,theta,thetaStar,phiStar)) + 
     (-1 + BCT)*Pair(Momentum(s,p1,W,theta,thetaStar,phiStar),Momentum(s,p2,W,theta,thetaStar,phiStar))*
     Pair(Momentum(s,q1,W,theta,thetaStar,phiStar),Momentum(s,q3,W,theta,thetaStar,phiStar))))};

  return constants*matrixElementBody;
} 

